import { BrowserRouter, Routes as RDRoute, Route } from 'react-router-dom'

import Home from "../pages/Home";
import SignIn from "../pages/SignIn";
import Tasks from "../pages/Tasks";

const Routes = () => {
   return(
    <BrowserRouter>
        <RDRoute>
            <Route path='/' element={ <Tasks /> } />
        </RDRoute> 
    </BrowserRouter>
   )
}

export default Routes;
